import React from 'react'
import {store_products} from '../../Assets/data'


export default function Store() {
    let createProducts = () => {
        for (const product in store_products) {
            return <p>{product.name}</p>
        }
    }
    return (
        <div>
            {createProducts}
        </div>
    )
}
